IF OBJECT_ID(N'dbo.seeder',N'V')IS NULL
BEGIN
EXECUTE(
'
CREATE VIEW seeder
AS
    SELECT RAND(CONVERT(VARBINARY, NEWID())) seed '
);
END

--///////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
--///////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
--///////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////

IF OBJECT_ID(N'dbo.PoblarStockAlmacen',N'P') IS NULL
BEGIN
EXECUTE(
'
create procedure PoblarStockAlmacen
as
	BEGIN
		DECLARE @ALMACEN INT = 6;
		DECLARE @PRODUCTOS INT = 3506;
		DECLARE @C INT = 1;
		WHILE @C<=@ALMACEN 
			BEGIN
				DECLARE @P INT = 1 ;
					WHILE @P<=@PRODUCTOS
						BEGIN
						
	DECLARE @max INT = ROUND(((25 - 20) * RAND() + 20), 0);
	DECLARE @min INT = ROUND(((10 - 5) * RAND() + 5), 0);	
	DECLARE @disponible INT = ROUND(((5 - 1) * RAND() + 1), 0);	
	
	values(@C,@P,0,@max,@min,@disponible);
	
							SET @P=@P+1;
						END
				SET @C = @C+1;
			END
	
	END;'
);
END


