IF OBJECT_ID(N'dbo.VENTAS_ANUALES',N'P') IS NULL
BEGIN
EXECUTE(
'
create PROCEDURE VENTAS_ANUALES
@ANO VARCHAR(4)
AS 
	BEGIN
	DECLARE @C INT = 1; 
	DECLARE @DATE DATE = ''01/01/''+@ANO;
	
	WHILE @C <=12 
		BEGIN
		execute GenerarVenta 500,@DATE , 7557447
		SET @DATE = (DATEADD(MONTH,1,@DATE));
		SET @C= @C+1;
		END
	END'
);
END

--///////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
--///////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
--///////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////

IF OBJECT_ID(N'dbo.Comprar_Productos',N'P') IS NULL
BEGIN
EXECUTE(
'
create procedure Comprar_Productos
as 
	BEGIN
		
		DECLARE @producto INT ;
		DECLARE @IDALMACEN INT ;
		
			DECLARE @TOTALPEDIDO INT = (SELECT SUM(VALOR) FROM PRECIO inner Join Producto on precio.id= producto.id_precio inner join dbo.almacen_producto_stock as aps on aps.id_producto=producto.id_producto where aps.cantidad_actual=10  );
			
			DECLARE @FECHA DATE = GETDATE();
			DECLARE @MINEMPLEADO  INT= ( SELECT TOP 1 id_empleado  	FROM empleado	ORDER BY id_empleado ASC) ;
			DECLARE @MAXEMPLEADO  INT =  (SELECT TOP 1 id_empleado  	FROM empleado	ORDER BY id_empleado DESC );
			
			
			
			declare cursor1 CURSOR 
			FOR  select id_producto,id_almacen from dbo.almacen_producto_stock where cantidad_actual = 0; 
			open cursor1 fetch next from cursor1 into @producto,@IDALMACEN
					
				while @@FETCH_STATUS = 0 
					begin 
						DECLARE @MAX INT = (SELECT cantidad_maxima from dbo.almacen_producto_stock 
						where id_producto = @producto and id_almacen = @IDALMACEN );
						
						DECLARE @MIN INT = (SELECT cantidad_minima from dbo.almacen_producto_stock 
						where id_producto = @producto and id_almacen = @IDALMACEN );
						
						set @MAX = ROUND(((@MAX  -@MIN) * RAND() + @MIN), 0);
						
						DECLARE @VALORPRECIO INT = (SELECT TOP 1 valor from Precio inner join producto on producto.id_precio=Precio.id 
							where producto.id_producto=@producto ORDER BY NEWID());
						DECLARE @VALORCOMPRA INT  = ROUND(((@VALORPRECIO - (@VALORPRECIO-@VALORPRECIO*0.12) -1) * RAND() + @VALORPRECIO), 0);

						DECLARE @EMPLEADO  INT=  ROUND(((@MAXEMPLEADO - @MINEMPLEADO -1) * RAND() + @MINEMPLEADO), 0);	
						
						values (@FECHA,@VALORCOMPRA*@MAX,@EMPLEADO,''Pedido por stock 0'')
						DECLARE @PEDIDO INT = SCOPE_IDENTITY();
												
						DECLARE @Varia int = ROUND(((15) * RAND() + 1), 0);
						
						
						DECLARE @FECHA_COMPRA DATE = DATEADD(DAY,@Varia,@FECHA);	
						DECLARE @PROVEEDOR INT = (SELECT TOP 1 id_proveedor from proveedor order by NEWID());
						
						values (@VALORCOMPRA*@MAX*0.13,@FECHA_COMPRA,@FECHA,@VALORCOMPRA*@MAX,@VALORCOMPRA*@MAX+@VALORCOMPRA*@MAX*0.13,@PROVEEDOR,@PEDIDO);
						
						DECLARE @COMPRA INT = SCOPE_IDENTITY();
						VALUES(@producto,@COMPRA,@MAX,@MAX*@VALORCOMPRA,@VALORCOMPRA);
						
						DECLARE @Varia_ingreso int = ROUND(((27) * RAND() + 1), 0);
						SET @FECHA = DATEADD(DAY,@Varia_ingreso,@FECHA);	
						DECLARE @VALOR INT = @VALORCOMPRA*@MAX;
						DECLARE @DEBITO INT = cast(@VALOR*0.13 AS INT);
						DECLARE @CREDITO INT = CAST(@VALOR*0.16 AS INT);	
						SET @EMPLEADO =  ROUND(((@MAXEMPLEADO - @MINEMPLEADO -1) * RAND() + @MINEMPLEADO), 0);
						values (''Contado Comprar_Productos'',@VALOR,@DEBITO,@CREDITO,@FECHA,@COMPRA,@EMPLEADO);
						DECLARE @INGRESO INT  = SCOPE_IDENTITY();
						
						--//INSERTAR EL KARDEX-INGRESO DEL PRODUCTO	
						VALUES(@producto,@IDALMACEN,@MAX,''I'',@FECHA);
					
						SET @FECHA = GETDATE();
						UPDATE dbo.almacen_producto_stock SET cantidad_actual=cantidad_actual+@MAX 
						where id_producto = @producto and id_almacen = @IDALMACEN;
					 fetch next from cursor1 into @producto,@IDALMACEN 
					 end 
				 close cursor1 
				 deallocate cursor1 
	
	END
'
);
END

